function Start(idActorPlayer, idActorGizmo)

	-- Send this user event to the activator gizmo's linked VGN quest to start the vignette
	local idController = Hydra.ActorsLinkedByActorInGroup(idActorGizmo, "VGN_CONTROLLER")[1];
	Hydra.EventSendToActor("BOUNTY_ASSASSINATE_GIZMO_ACTIVATED", idActorGizmo, idController);

end

